import React from 'react';
import '../App.css';
import {TextStyled} from "../styledComponent/TextStyled";
import {TextFilledStyled} from "../styledComponent/TextFilled-styled";
import {ButtonFilledStyled} from '../styledComponent/ButtonFilled-styled';
import {ButtonStyled} from '../styledComponent/Button-styled';
import {useStore} from "effector-react/effector-react.mjs";
import {currentUser, deleteUser, rememberUser} from "../BLL/effector/usersStoreLogined";
import {ExitStyled} from "./Exit-styled";
import {deletePasswordHeh, deleteUserHeh} from "../BLL/effector/usersStore";
import {useHistory} from "react-router-dom";
import Login from "./Login";


const Exit: React.FC = () => {
    //const username = useStore()
    const history = useHistory()
    const handleLogoutUser = () => deleteUser()
    const deleteLogoutUserHeh = () => deleteUserHeh()
    const deleteLogoutPasswordHeh = () => deletePasswordHeh()

    const exit = () => {
        handleLogoutUser()
        history.push('/login')
        deleteLogoutUserHeh()
        deleteLogoutPasswordHeh()
    }

    return (
        <ExitStyled>
            <TextStyled textSize={20} color={'black'} fontWeight={'bold'}>
                You are in system right now. Press the button to logout.
            </TextStyled>
            <ButtonFilledStyled justifycontent={'center'} width={100} height={30}>
                <ButtonStyled onClick={exit}>
                    Logout
                </ButtonStyled>
            </ButtonFilledStyled>
        </ExitStyled>

    )
}


export default Exit;
